import React, { Component } from 'react';

class Check extends Component {
    state = { 
        name: "Habib",
        Id:this.props.roll
     }
     clickHandler = () => {
         this.setState({
             name:"Tonoy"
         });
     }
    render() { 
        return ( 
            <div>
                <h2>Hello {this.state.name} </h2>
                <h4>Id: {this.state.Id}</h4>
                <button onClick={this.clickHandler}>Click Me</button>
            </div>
         );
    }
}

export default Check;
